    const cat=[
        {
            title:"Shirt",
            imgurl:"https://3.imimg.com/data3/OI/OJ/MY-8728688/coat-1000x1000.jpg"
        },
        {
            title:"Pants",
            imgurl:"https://3.imimg.com/data3/OI/OJ/MY-8728688/coat-1000x1000.jpg"
        },
        {
            title:"Coat",
            imgurl:"https://3.imimg.com/data3/OI/OJ/MY-8728688/coat-1000x1000.jpg"
        },
        {
            title:"Shoes",
            imgurl:"https://3.imimg.com/data3/OI/OJ/MY-8728688/coat-1000x1000.jpg"
        },
        {
            title:"T-shirt",
            imgurl:"https://3.imimg.com/data3/OI/OJ/MY-8728688/coat-1000x1000.jpg"
        }
    ]
    return (
        <div className="App">
             <div className="catagories">
                {cat.map((title,imgurl)=>(
                    <div className="catagory-container" style={{backgroundImage:`url(https://3.imimg.com/data3/OI/OJ/MY-8728688/coat-1000x1000.jpg)`}}>
                        <div className="catagory-body"> 
                            <h2>{title.title} </h2>
                            <button className="button">Shop Now</button>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    )
}
export default Catagory
